  \"Oceanographic profile data collected from CTD casts aboard NAVIGATION RESPONSE
  TEAM 7 as part of project S-N908-NRT3-10 in the North Pacific Ocean from 2010-08-16
  to 2010-09-15 (NCEI Accession 0130699)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
