  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130699 includes physical
  and profile data collected aboard the NAVIGATION RESPONSE TEAM 7 during project
  S-N908-NRT3-10 in the North Pacific Ocean from 2010-08-16 to 2010-09-15. These data
  include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY
  and WATER TEMPERATURE. The instruments used to collect these data include CTD. These
  data were collected and submitted by the NOAA Office of Coast Survey in support
  of hydrographic multibeam surveys to meet NOAA charting requirements.\",\n\t\"license_title\":
